-- warcraft.stats_events definition

CREATE TABLE `stats_events` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `link` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `last_scraped` datetime NOT NULL DEFAULT '2010-06-30 16:40:40',
  `last_changed` datetime NOT NULL,
  `tier` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `first` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `second` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `third` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `abbreviation` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT '',
  PRIMARY KEY (`id`),
  UNIQUE KEY `link` (`link`),
  KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=4805 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci ROW_FORMAT=DYNAMIC;

